    \ and proper data retention periods, (b) comply with applicable notification requirements,\
    \ (c) maintain and comply with a written privacy policy that describes your privacy\
    \ practices regarding data and information you collect and use, and which is at\
    \ least as protective of users as the Privacy Statement, (d) include an accessible\
