    \ so allows, and (e) obtain consent from end users that is sufficient for the\
    \ purposes of your agreement with the end user prior to giving us information\
    \ that you independently collected from them.\n\nIn addition to complying with\
    \ your obligations under applicable law (including General Data Protection Regulation\
    \ (GDPR) (EU) 2016/679) you will use current data. You may keep your data current\
    \ by regularly refreshing the data, interfacing with a Microsoft API or Microsoft\
    \ tool to maintain current data, or other processes that ensure changes to Microsoft\
    \ data are accurately reflected.\n\nExcept as otherwise set forth herein, you\
    \ will promptly delete all data and Content collected or processed through the\
    \ Services, when: (a) a user abandons your application, uninstalls your application,\
    \ closes their account with you, or otherwise abandons the account, or (b) you\
    \ cease use of the Services. You may, however, keep aggregated data, provided\
    \ that no information identifying a specific person could be inferred or created\
    \ from such data and such actions otherwise comply with this Agreement and applicable\
    \ law.\n\nUnless you have a lawful basis for retaining Personal Data (as defined\
    \ in the GDPR), you must delete all Personal Data accessed or processed through\
    \ the Services within 30 days of receiving the data.\n\nCompliance with law. We\
