    \ applicable security breach notification laws, but not including any laws applicable\
    \ to you or your industry that are not generally applicable to information technology\
    \ services providers. You will comply with all laws applicable to your User Data,\
    \ and use of the Services, including any laws applicable to you or your industry.\n\
    \nCertifications and compliance. The Developer Services shall be subject to any\
