    \ Services. These obligations do not apply to any other elements of the Services.\n\
    \nMonitoring; Audit. We may monitor your access and use of the Services (including\
    \ applicable products and services, website, Content, and data) for purposes of\
    \ monitoring your compliance with this Agreement. Further, your access and use\
