    \ premises, information, systems, books, and records relating to your use of the\
    \ Services to enable Microsoft to conduct the audit. If requested, you must provide\
    \ us with proof of your compliance with this Agreement.\n\n4. Customer accounts,\
    \ customer conduct, and feedback\nAccount creation. If any of the Services requires\
